<script>
function enviarParaDrive(nomePaciente, semana, pdfBlob) {
  const reader = new FileReader();
  reader.onloadend = function () {
    const base64 = reader.result.split(',')[1];
    const dados = {
      nomePaciente: nomePaciente,
      semana: semana,
      nomeArquivo: `Consulta_${semana}.pdf`,
      base64pdf: base64
    };

    fetch("https://script.google.com/macros/s/AKfycbz726bRq3cHtWOn4473KzD--dpj4Soih8FKgZVKmSi4oCJxHMjvfHYWmuWReh2RCfCYsQ/exec", {
      method: "POST",
      body: JSON.stringify(dados),
      headers: { "Content-Type": "application/json" }
    })
    .then(res => res.text())
    .then(resp => alert("‚úÖ PDF enviado para o Drive com sucesso!"))
    .catch(err => alert("Erro ao enviar: " + err));
  };
  reader.readAsDataURL(pdfBlob);
}
</script>
